import React, { useState } from 'react';
import './InsuranceForm.css';

const InsuranceForm = () => {
  const [gender, setGender] = useState('Male');

  return (
    <div className="form-page">
      <div className="header">
        <img src="https://www.policybazaar.com/images/policybazaar-logo.png" alt="Policybazaar Logo" className="logo" />
        <div className="header-right">
          <button className="claim-assistance">Claim Assistance</button>
          <button className="talk-expert">Talk to Expert</button>
        </div>
      </div>
      <div className="main-content">
        <h1>‚Çπ 1 Crore life cover starting from ‚Çπ483/month*</h1>
        <div className="discounts">
          <span className="online-discount">üí∞ Get an Online Discount of 15%*</span>
          <span className="pb-promise">üìà PB Promise Guarantee*</span>
        </div>
        <div className="gender-buttons">
          <button
            className={gender === 'Male' ? 'active' : ''}
            onClick={() => setGender('Male')}
          >
            Male
          </button>
          <button
            className={gender === 'Female' ? 'active' : ''}
            onClick={() => setGender('Female')}
          >
            Female
          </button>
        </div>
        <div className="form-group">
          <label>Your Name</label>
          <input type="text" defaultValue="PRATHAM R SHET" />
        </div>
        <div className="form-group">
          <label>Date of Birth</label>
          <input type="date" defaultValue="1997-02-21" />
          <span>28 years</span>
        </div>
        <div className="form-group">
          <label>Mobile Number</label>
          <select>
            <option value="+91">India +91</option>
          </select>
          <input type="tel" defaultValue="****5442" />
        </div>
        <button className="view-plans">View Plans</button>
        <div className="expert-assist">
          <img src="https://www.policybazaar.com/images/chat-icon.png" alt="Chat" />
          Only certified Policybazaar expert will assist you
          <label className="whatsapp-toggle">
            <input type="checkbox" />
            <span>Get updates on WhatsApp</span>
          </label>
        </div>
        <div className="footer-note">
          By clicking, you agree to our Privacy Policy | Terms of Use & Disclaimers
        </div>
      </div>
      <div className="footer">
        <p>Policybazaar is one of India's leading digital insurance platform</p>
        <div className="rating">
          <span>‚òÖ‚òÖ‚òÖ‚òÖ‚òÜ</span>
          <span>9.7 Crore Registered Consumers</span>
          <span>51 Insurance Partners</span>
          <span>4.9 Crore Policies Sold</span>
        </div>
      </div>
    </div>
  );
};

export default InsuranceForm;
